import React, { Component } from 'react'

export default class HelloFile extends Component {
  constructor(){
    super()
    this.state={
      msg:'Hello I am Here......'
    }
    this.display = this.display.bind(this)
  }
  display(){
    this.setState({
      msg:"Message Changed"
    })
  }

  render() {
    return (
      <>
        <h2>Practice</h2>
        <p>{this.state.msg}</p>
        <button onClick={this.display()} >Click Me</button>

      </>
    )
  }
}
